import React from "react";
import Link from "next/link";

class Page2 extends React.Component {
  render() {
    return (
      <div>
        <h1>2ページ目</h1>
        <Link href="/">
          <a>戻る</a>
        </Link>
      </div>
    );
  }
}

export default Page2;
